import React from 'react';
import Button from './Button.jsx'

function ButtonContainer(){

    function handleClick(event){
        let value = event.Button.text;
        console.log(value);
    }

    return <div className='buttonContainer'>
        <Button type = "function" text = "AC"/>
        <Button type = "function" text = "±"/>
        <Button type = "function" text = "%"/>
        <Button type = "operator" text = "÷"/>
        <Button text = "7"/>
        <Button text = "8"/>
        <Button text = "9"/>
        <Button type = "operator" text = "×"/>
        <Button text = "4"/>
        <Button text = "5"/>
        <Button text = "6"/>
        <Button type = "operator" text = "-"/>
        <Button text = "1"/>
        <Button text = "2"/>
        <Button text = "3"/>
        <Button text = "+"/>
        <Button type = "number-0" text = "0"/>
        <Button text = "."/>
        <Button type = "operator" text = "="/>
    </div>;
}

export default ButtonContainer;
